def popitem(self):
    """
    Remove and return the `(key, value)` pair least recently used.
    """
    if len(self) == 0:
        raise KeyError('popitem(): dictionary is empty')
    key_to_pop = next(iter(self))
    value_to_pop = self[key_to_pop]
    del self[key_to_pop]
    return (key_to_pop, value_to_pop)

