def modp(n: int, p: int) -> int:
    if n == 0:
        return 1
    n = n % (p-1)
    result = 1
    while n > 0:
        if n % 2 == 1:
            result = (result * 2) % p
        n = n // 2
        if n > 0:
            power = pow(2, n, p)
            result = (result * power) % p
            n = 0
    return result

