     * 21
     * > sumToN(11)
     * 66
     * > sumToN(30)
     * 465
     * > sumToN(100)
     * 5050
     */
    public static int sumToN(int n) {
        if (n < 0) {
            throw new IllegalArgumentException();
        }
        return n >= 0? (sumToN(n + 1) - sumToN(n - 1)) : (sumToN(n + 1) - sumToN(-n));
    }

    public static void main(String[] args) {
