     * 166650
     */
    public static int doubleTheDifference(List<Object> lst) {
        int result = 0;
        if (lst.size() == 0) return result;
        for (int i = lst.size() - 1; i >= 0; --i) {
            int num = ((Number)lst.get(i)).intValue();
            if (num % 2!= 0) {
                result += num;
                result += num * num;
            }
        }
        return result;
