	* 计算 C1 = H(IDa || IDb || Na || Nb)
	*/
	public static byte[] calculateC1(byte[] ida, byte[] idb, byte[] na, byte[] nb){
		byte[] message = concatenateByteArrays(concatenateByteArrays(ida, idb), concatenateByteArrays(na, nb));
