     * >>> derivative([3, 1, 2, 4, 5])
     * [1, 4, 12, 20]
     * >>> derivative([1, 2, 3])
     * [2, 6]
     *
     * > derivative([3, 1, 2, 4, 5])
     * [1, 4, 12, 20]
     * > derivative([1, 2, 3])
     * [2, 6]
     * > derivative([3, 2, 1])
     * [2, 2]
