import java.util.*;

class Maximum {
    public static List<Integer> maximum(List<Integer> arr, int k) {
        Collections.sort(arr, Collections.reverseOrder());
        List<Integer> topK = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            topK.add(arr.get(i));
        }
        return topK;
    }
}

